    const coursesContainer = document.getElementById('courses');
    const searchInput = document.getElementById('searchInput');
    const progressFilter = document.getElementById('progressFilter');

    function renderCourses() {
      const searchTerm = searchInput.value.toLowerCase();
      const progressValue = progressFilter.value;

      coursesContainer.innerHTML = '';

      const filteredCourses = coursesData.filter(course => {
        const nameMatches = course.name.toLowerCase().includes(searchTerm);
        
        let progressMatches = true;
        if (progressValue !== 'all') {
          const [min, max] = progressValue.split('-').map(Number);
          progressMatches = course.progress >= min && course.progress <= max;
        }

        return nameMatches && progressMatches;
      });

      filteredCourses.forEach(course => {
        const courseElement = document.createElement('div');
        courseElement.classList.add('course');
        courseElement.innerHTML = `
          <div class="course-header">
            ${course.image ? `
              <img src="${course.image.src}" 
                   alt="${course.image.alt}" 
                   class="course-image"
                   loading="lazy"
                   onerror="this.onerror=null; this.src='images/default-course.png'"
                   style="opacity:0" 
                   onload="this.style.opacity=1">
            ` : `
              <div class="image-placeholder"></div>
            `}
            <h2>${course.name}</h2>
          </div>
          <p><i class="fas fa-check-circle"></i> Lessons Completed: ${course.lessonsCompleted}/${course.totalLessons}</p>
          <p><i class="fas fa-clock"></i> Upcoming Quiz: ${course.upcomingQuiz}</p>
          <div class="progress-bar">
            <div class="progress" style="width: ${course.progress}%;"></div>
          </div>
          <p><i class="fas fa-tachometer-alt"></i> Progress: ${course.progress}%</p>
         <button onclick="setReminder('${course.id}')" ><i class="fas fa-bell" class="set reminder"></i> Set Reminder</button>
         <br><br>
<button onclick="removeReminder('${course.id}')" class="remove-btn"><i class="fas fa-bell-slash" class="remove reminder"></i> Remove Reminder</button>
<p id="reminder-${course.id}"></p>
          `;
        coursesContainer.appendChild(courseElement);
      });
    }

    const savedReminders = JSON.parse(localStorage.getItem('reminders')) || {};

    function setReminder(courseId) {
      const time = prompt('Set reminder time (e.g., 7:00 PM)');
      if (time) {
        savedReminders[courseId] = time;
        localStorage.setItem('reminders', JSON.stringify(savedReminders));

        const reminderElement = document.getElementById(`reminder-${courseId}`);
        reminderElement.textContent = ` Reminder set for: ${time}`;
        alert(`Reminder set for ${time}`);
      }
    }
    function removeReminder(courseId) {
  if (savedReminders[courseId]) {
    delete savedReminders[courseId];
    localStorage.setItem('reminders', JSON.stringify(savedReminders));
    
    const reminderElement = document.getElementById(`reminder-${courseId}`);
    if (reminderElement) {
      reminderElement.textContent = '';
    }
    alert('Reminder removed successfully');
  } else {
    alert('No reminder found to remove');
  }
}


    // Initialize reminders on load
    function initReminders() {
      coursesData.forEach(course => {
        if (savedReminders[course.id]) {
          const reminderElement = document.getElementById(`reminder-${course.id}`);
          if (reminderElement) {
            reminderElement.textContent = ` Reminder set for: ${savedReminders[course.id]}`;
          }
        }
      });
    }

    searchInput.addEventListener('input', renderCourses);
    progressFilter.addEventListener('change', renderCourses);

    // Initial render
    renderCourses();
    initReminders();